import React from 'react';
// import '../App.css';
import {Button} from '../Button';
import {Link} from 'react-router-dom';
import './bookdisplay.css';
import FeaturedBook from './bookdisplay';
import cchcover from './cchcover.jpg';

function Novels() {
    return (
        <>
    <div>
        <h1>Novel Display</h1>
            <div>
                <ul>
                    <FeaturedBook 
                    src={cchcover}
                    text="Check out Cross Country Hearts!"
                    label="book"
                    path="/"
                    />
                </ul>
            </div>
    </div>
        </>
    )
}

export default Novels;
